$(function(){$.ajax({type:"get",url:ura+"/tenant/getTenantMyHistoryByPhoneNumber/"+localStorage.getItem("hone"),async:true,dataType:"json",success:function(data){console.log(data.data);var e="";if(data.data==''){$('article ul').html('抱歉，您暂时没有诊所记录！');$('article ul').css({marginTop:'200px',color:"#666565",fontSize:'0.32rem',textAlign:'center'})}else{for(var i in data.data){console.log(i);e+="<li index='"+data.data[i].id+"'><p>诊所名称：<span>"+data.data[i].tenantname+"</span></p><dl><dt><span>诊所地址：</span><i>"+data.data[i].address+"</i></dt><dd><a href=tel:'"+data.data[i].bookmobile+"'>电话咨询</a></dd></dl></li>"}$('article ul').html(e)}}})});